import openai
from dotenv import load_dotenv
import os
import base64
from openai import OpenAI
import json
from api.util.maps_util import autocomplete_location

load_dotenv()

OPENAI_API_KEY = os.getenv("OPENAI_API_KEY_NEW")
print(OPENAI_API_KEY)


def extract_calendar_info_from_base64(base64_image):
    try:
        client = openai.OpenAI(api_key=OPENAI_API_KEY)
        response = client.chat.completions.create(
            model="gpt-4o-mini",
            messages=[
                {
                    "role": "user",
                    "content": [
                        {
                            "type": "text",
                            "text": """Extract the information in the provided schedule image. Return a strictly JSON formatted array of objects of all the events in the image. Each object should have a 'day', 'location', 'title', 'start', and 'end' field.
                            
                            - location - The exact location of the event or class. If not available, provide an empty string. For example, 'McDonell 202A'. Always provide the location in the format it was given in, which will typically follow 'Building Room'.
                            
                            - title - The title of the event or class. For example, 'Calculus 1' or 'Calculus I' or 'Calculus'. If not available, provide an empty string.
                            
                            - start/end - of the event or class in HH:MM AM/PM format. If not available, provide an empty string. For example, '10:00 AM'.
                            
                            - day - The day of the week of the event or class. Can be found directly above each event's cell in the uppermost row. For example, 'Monday'. If not available, provide an empty string.
                            """
                        },
                        {
                            "type": "image_url",
                            "image_url": {"url": f"data:image/jpeg;base64,{base64_image}"},
                        },
                    ],
                }
            ],
        )
        response = response.choices[0].message.content
        print(response)
        start_index = response.find('[')
        end_index = response.rfind(']') + 1
        json_array_str = response[start_index:end_index]
        calendar_info = json.loads(json_array_str)
        return {
            "data": calendar_info,
            "success": True,
        }
    except Exception as e:
        print(e)
        return {
            "data": [],
            "success": False,
        }
        
def extract_building_name(string):
    try:
      client = openai.OpenAI(api_key=OPENAI_API_KEY)
      response = client.chat.completions.create(
        model="gpt-4o-mini",
        messages=[
              {
                  "role": "user",
                  "content": [
                      {
                          "type": "text",
                          "text": """Given a campus address and University name, try your best, based on your knowledge and inferencing abilities, to extract the building name from the address. If you cannot determine the building name, respond with an empty string (""). 
                          
                          For example, if the inputted string is 'Fine Hall 110 Princeton University', return 'Fine Hall'. If the inputted string is 'C126 Grousbeck Princeton University', return 'Grousbeck'.
                          
                          Your response should be a single string, which is the extracted building name, and nothing else. Do not return any explanation or additional text.
                          """
                      },
                      {
                          "type": "text",
                          "text": string,
                      }
                  ],
              }
          ],
      )
      response = response.choices[0].message.content
      print(response)
      return {
          "data": response,
          "success": True,
      }
    except Exception as e:
        print(e)
        return {
            "data": "",
            "success": False,
        }
        
  
def get_coords_from_schedule_name(location, institution):
    try:
        combined_name = location + " " + institution
        extracted_building_name = extract_building_name(combined_name)
        if not extracted_building_name["success"]:
            return {
              "success": False,
              "latitude": None,
              "longitude": None,
            }
        combined_name = extracted_building_name["data"] + " " + institution
        longitude, latitude = autocomplete_location(combined_name)
        if not longitude or not latitude:
            return {
              "success": False,
              "latitude": None,
              "longitude": None,
            }
        print("combined name", combined_name)
        print("extracted building name", extracted_building_name["data"])
        print("longitude", longitude)
        print("latitude", latitude)
        return {
          "success": True,
          "latitude": latitude,
          "longitude": longitude,
        }
    except Exception as e:
        print(e)
        return {
            "success": False,
            "latitude": None,
            "longitude": None,
        }
        
  
if __name__ == "__main__":
    schedule_name = "C126 Grousbeck"
    institution = "Princeton University"
    response = get_coords_from_schedule_name(schedule_name, institution)
    longitude = response["longitude"]
    latitude = response["latitude"]
    print(longitude, latitude)

        


